arou solía pertenecer y por eso le pidió el favor de unirse a él, para mantenerlo con vida, ya que al tener pocos miembros corría el riesgo de disolverse. Sin embargo, por más que el club es de literatura clásica, Houtarou y los otros miembros del club se dedican a resolver cualquier misterio que surja dentro o fuera de su escuela. Houtarou es un chico perezoso, que prefiere no hacer nada para \\\"ahorrar energías\\\", pero Chitanda Eru (miembro del club de Literatura Clásica) lo obligará a que resuelva todos los enigmas y preguntas que se le presenten.','Serie','Completado',22,'BD','\"7\",\"20\",\"23\"','','Lunes',0,11,1,1,0,0,1,0,1,1,0,0,0,0,0,0,'Japonés','Español Neutro',0,0,0,0,0,0,'2016-01-06 00:43:36','2016-01-06 05:43:36'),(51,'Itsuka Tenma no Kuro Usagi','A Dark Rabbit has Seven Lives','いつか天魔の黒ウサギ','itsuka-tenma','itsukatenmanokurousagi1688779412.jpg','51_itsuka-tenma_ItsukaTenmanoKuroUsagi-Wallpaper28129_zps58c1ce87.JPG','itsukatenmanokurousagi1503511866.jpg','','Taito Kurogane, estudiante de instituto que practicó karate hasta que una lesión le impidió continuar. Él conoció en su niñez a Saitohimea, una chica con quien prometió estar siempre juntos, aunque sus recuerdos terminaron por borrarse cuando fueron atacados por un poderoso hechicero que capturó a Saitohimea para poder hacer uso de los poderes de ésta. Taito terminará por morir en un accidente y al volver en sí, su sangre le traerá de nuevo aquella promesa, junto con una habilidad que lo hace prácticamente inmortal, la cual deberá poner a prueba si quiere recuperar a Saitohimea.','Serie','Completado',12,'BD','\"2\",\"3\",\"6\",\"8\",\"10\",\"29\"','','Lunes',0,10,1,1,0,0,1,0,1,1,0,0,0,0,0,0,'Japonés','Español Neutro',0,0,0,0,0,0,'2016-01-06 00:57:37','2016-01-06 05:57:37'),(52,'Kimi no Iru Machi','A Town Where You Live','君のいる町','kimi-no-iru-machi','kiminoirumachi399527049.jpg','52_kimi-no-iru-machi_Kimi-no-Iru-Machi-anime-ova.jpg','kiminoirumachi2036280377.jpg','','Yuzuki Eba se muda desde Tokio a 