umana. Kaneki Ken, un joven y tímido universitario sobrevive a una operación de trasplante de órganos tras ser atacado y casi devorado por uno de ellos; tras abandonar el hospital Kaneki sufre un extraño proceso de metamorfosis que provocará un inesperado giro en su vida, los órganos trasplantados pertenecían al Ghoul muerto durante el ataque... ahora, mitad humano y mitad Ghoul tendrá que aprender a vivir de nuevo.','Serie','Completado',12,'BD','\"1\",\"10\",\"11\",\"20\",\"24\",\"25\",\"27\"','','Lunes',0,3,1,1,0,0,1,0,1,1,0,0,0,0,0,0,'Japonés','Español Neutro',0,0,5,0,31,31,'2016-02-06 15:35:59','2016-02-06 20:35:59'),(65,'Zankyō no Terror','Terror in Resonance','残響のテロル','Zankyou-no-terror','zankynoterror1094904909.jpg','65_Zankyou-no-terror_Zankyou no Terror - 02 - Large 22.jpg','zankynoterror1464279962.jpg','','Tokio ha sufrido un repentino ataque terrorista y la única evidencia de los culpables es un confuso y extraño video subido a Internet. La policía, desconcertada por tan críptica pista, se encuentra impotente para detener la paranoia, la cual solo aumenta a través de Japón. Mientras el mundo busca a los autores intelectuales, dos chicos misteriosos -que aparentemente no deberían existir- llevan magistralmente su plan a cabo. Maldecidos a caminar por el mundo con los nombres Nine y Twelve, los dos se combinan para formar \"Sphinx\" una entidad clandestina que está determinada a despertar a las personas de su letargo.','Serie','Completado',11,'BD','\"11\",\"20\",\"25\"','','Lunes',0,3,1,0,0,0,1,0,1,0,0,0,0,0,0,0,'Japonés','Español Neutro',9,9,9,9,4,4,'2016-01-14 05:49:34','2016-01-14 10:49:34'),(66,'Aoharu x Kikanjuu','Aoharu x Machinegun','青春×機関銃','aoharu-x-kikanjuu','66_aoharu-x-kikanjuu_76271[1].jpg','66_aoharu-x-kikanjuu_animanga_266341.jpg','aoharuxkikanjuu2062037986.jpeg','','Aoharu x Kikanjuu nos cuenta la historia de Hotaru Tachibana, una estudiante de secundaria que se hace pasar por un chico. Por culpa de extrañas circunstancias, la protagonista s