INSERT INTO `contactos` (`id`, `nombre`, `nick`, `email`, `pagina_facebook`, `comentarios`, `created_at`, `updated_at`) VALUES (1,'Debra Morgan','DebMorgan','admin@hentaikku.com','https://www.facebook.com/iDebMorgan','Hola bakkas!','2016-03-17 21:03:49','2016-03-17 21:03:49'),(2,'Franylando','Franky','admin@anikku.com','https://www.facebook.com/FransJoao','Testsu','2016-03-17 21:05:02','2016-03-17 21:05:02'),(3,'Taufik Rubra','taufik','taufik-bizdev@cpx24.com','http://cpx24.com','Hello,\r\n\r\nMy name is Taufik from CPX24. We are a media digital agency and we work our own network of publishers and advertisers.\r\n\r\nThe reason i am contacting you is that we\'re interested in partnership with you in advertising area and traffic generation. We have tons of campaigns that are ready to be monetized with your web visitors. You will generate a good revenue if you join our network as publisher. We also have several publishers on your same niche which are getting excellent results already.\r\n\r\nWe are interested on placing our tags on your website, they will fire a pop when a visitor performs a click on your website (You’ll get revenue stream from this). We pay $2 per 1000 visitors depends to geo and traffic quality. We also have a good referral program and various payment options.\r\n\r\nIf you have any questions please feel free to contact me back or to contact us on Skype: aff_support2\r\n\r\nOR\r\n\r\nClick the following link to read our FAQ: http://cpx24.com/index.php?menu=faq\r\n\r\nIf you would like to signup, please use the following link: http://cpx24.com/index.php?menu=join    \r\n\r\nPlease do not hesitate to contact me or add us on Skype; we will optimize your account for best result.\r\n\r\nWe look forward to work with you.\r\n\r\nBest Regards,\r\nTaufik Rubra\r\nCPX24 Team\r\n','2016-03-26 06:33:25','2016-03-26 06:33:25'),(4,'Corrector','.','Literatura@outlook.cl','.','Buenas:\r\n\r\nTengo un uso adecuado de la lengua, me preguntaba si buscan corrector. No tengo experiencia anterior en estos temas y queria comenzar a editar para corregir errores, pues es algo que me sirve como experiencia y me ayuda personalmente.\r\n\r\nTengo disponibilidad de 1 hora diaria o mas al dia (En la noche generalmente).\r\n\r\nSi necesitanun corrector, estaria disponible, aunque como soy nuevo en esto tendrian que darme los primeros pasos.\r\n\r\nSaludos\r\n\r\n','2016-03-29 19:49:49','2016-03-29 19:49:49'),(5,'Corrector','.','Literatura@outlook.cl','.','No se si les habra llegado el mensaje anterior.\r\n\r\nLa cosa es que me gustaria empezar a corregir en algun Fs y me preguntaba si actualmente este busca corrector.\r\n\r\nSeria mi primera vez haciendo esto, pero me imagino que ustedes ayudarian en los primeros pasos, eso\r\n\r\nSaludos.','2016-03-29 19:52:07','2016-03-29 19:52:07'),(6,'MARCO','','MADEXTREME07@GMAIL.COM','','Saludos, gracias por la serie de:  Shoujotachi wa Kouya o Mezasu  una ? sacaran la OVA si es posible gracias.','2016-04-13 10:01:14','2016-04-13 10:01:14'),(7,'Holo','Holo','holojunketsu@outlook.com','','La codificación del anime Onigiri está muy mal hecha, creo que le iban a meter 2 pasadas pero solo le hicieron una por lo cual quedó en ABR y no 2pass \"hex=2\" (veryfast), 1 ref y 0 bf.\r\n\r\nEl mkv se ve terrible y no tiene fuentes. Sería bueno que lo dejaran tal cual como lo toman de Kaitou (10 bits) para los que buscan calidad ya que la compatibilidad la da el otro con el mp4, que de hecho ese tiene audio HE-AAC y la PS3 no la reproduce. Debe ser AAC-LC\r\n\r\nSe que pueden mejorar ya que vi Sakurako de este fansub por UF. No es necesario que metan hardsubs al mkv.. vamos!!','2016-04-16 06:39:16','2016-04-16 06:39:16'),(8,'Jesús','KhaOz130','shuniorxd@hotmail.com','','Porfavor les agradeceria un monton :3 si resuben el link caido del cap 23 de owari no seraph, porfavor pq me sale error en descriptacion o algo asi, resubanlo es el unico cap q me falta :C','2016-04-20 08:08:48','2016-04-20 08:08:48'),(9,'ricardo gomez ivera','','ricardoz1773@gmail.com','','por que me bloqueo en FACEBOOK no puedo enviar mensajes a preguntar sobre animes y que paso con el anime Hundred que van atrasados por tres caps y onigiri por 1 si no es molestia mi pregunta\r\n','2016-04-23 04:51:35','2016-04-23 04:51:35'),(10,'Pako','roxashow','roxashowlett@gmail.com','','En el anime de Hundred, Hno podrian poner los subs un poco mas neutrales??','2016-05-02 04:04:29','2016-05-02 04:04:29'),(11,'dania castro','shizue','shizue8.dc@gmail.com','shizue hikary','ola soi dany me encaria unimer asu grupo de hentaiky pero necesito un pass para poder regristrarme me necanta mucho su pag espero sigan compartiendo de todo gracias por su tiempo espero pueda registrame ','2016-05-15 05:52:04','2016-05-15 05:52:04'),(12,'YUKITO UCHIJA','LAVI BOOKMAN','bleachnatsu@outlook.com','facebook','esta pagina esta bien xd espero y siguan subiendo mas series ','2016-05-21 19:49:00','2016-05-21 19:49:00'),(13,'Rodrigo Albert','TioKelly','jdumpi@hotmail.com','','Hola, una consulta podrian subir esta serie en 720p ( 300mb ) y sin censura?\r\n\r\nJoukamachi no dandelion \r\n\r\nGracias :D \r\n\r\nP/D: Muy buenos trabajos Saludos','2016-05-30 05:47:53','2016-05-30 05:47:53'),(14,'hero','nas','hans_pauw@hotmail.nl','','i want to ask you to sub the anime dragon quest dai no bokan','2016-06-02 16:35:57','2016-06-02 16:35:57'),(15,'sangdragz','sangdragz','lolifanatico@gmail.com','www.jntai.xyz','Hola! Soy el admin de una web hentai y me preguntaba si no les interesaria hacer un intercambio de banners, parece que en su pagina usan banners de 300x30 lo cual yo no tendria problemas en hacerme uno de esas medidas, pero si necesitaria saber si aceptan gif o si el contenido de la imagen puede tener xxx. Si no tienen problema y les interesa intercambiar, mandenme su banner de 125x125 o de 88x31.','2016-06-08 21:43:07','2016-06-08 21:43:07'),(16,'ricardo diaz','soniczx','ryusukezx13@gmail.com','https://www.facebook.com/ricardoisrael.diaznavarrete','quiero poder colaborar porfavor en coloreado y limepieza de mangas soy diseñador grafico y me gsutaria colaborar si me permiten ayudar ya que gracias al manga se me abrieron puerta','2016-06-16 03:42:18','2016-06-16 03:42:18'),(17,'Edward','','edward@insticator.com','','Hi,\r\n\r\nHope all is well.\r\n\r\nWe would love to partner with you.\r\n\r\nAre you available to speak sometime this week?','2016-06-24 21:13:26','2016-06-24 21:13:26'),(18,'Andrea ','','Lastresempai@gmail.com','https://m.facebook.com/yukiandrea.tachibana','Tengo en mega la temporada de zoku sayonara zetsubou sensei (en japones sin subtitulos.. ) ..los ovas de goku y zan sayonara zetsubou sensei (estos si tienen subtitulos en ingles) y un especial ,todos estan en calidad 1280x720x264 AAC.Mp4 y algunos estan en .mkv y me gustaria si pudieran traducirlos al español..para que las nuevas generaciones la puedan tener en esta calidad.. porfavor.. si les interesa ..me avisan para pasarle los link que tengo en mega... (todo los caps pesan alrededor de 500-900 mb)..se que es dificil..pero trato de aportar   porfavor..','2016-07-03 04:19:24','2016-07-03 04:19:24'),(19,'Maria Martin','','m.martin@adnow.com','adnow.com','Buenos dias!\r\n\r\nMe llamo Maria, soy representante de la compania de publicidad internacional Adnow.\r\n\r\nEncontramos su sitio web muy interesante y nos gustaria comprar espacios publicitarios en el.\r\n\r\nPodemos proponerle las variantes siguientes de la cooperacion:\r\n\r\n1.CPM (el pago por cada 1000 impresiones)\r\n2.Precio fijo por un periodo\r\n3.Registracion independiente en nuestra sistema http://es.adnow.com/, es la cooperacion por el formato CPC, el pago por cada click. Ubicacion para la publicidad Usted elige independientemente.\r\n\r\nPagos por adelantado el 100 % por dos medios de cooperacion- precio fijo o CPM. Para medio CPC puede tener el pago semanal. Elija cual de estos tres metodos le conviene mas.\r\n\r\nSi esta interesado, ¿podemos obtener una captura de pantalla con las estadisticas de las visitas por ultimo mes o ultima semana?\r\n\r\n\r\niEn la espera de su respuesta positiva!\r\n\r\nUn cordial saludo,  \r\nMaria\r\nSales manager','2016-07-04 15:44:18','2016-07-04 15:44:18'),(20,'Andrés','Mystix','andresantigoloretoaguero@hotmail.com o andresantigoloretoaguero@gmail.com','','Quisiera aplicar, pero tengo una duda (tal vez sea un poco estúpida xd): Cuándo hablan de \"Corrector\", ¿a qué se refieren?','2016-07-22 06:26:42','2016-07-22 06:26:42'),(21,'Kun','Kun','josecitokun@htmail.com','','Son el mejor fansub que visto y creanme he visto varios, tiene una excelente calidad de trabajo.\r\nQuisiera saber cuento cobran por pedir ciertas series en especifico\r\nquisiera tener tner todas las series de monogatari... pue4s descarguè t sukimonogatari y es genial el trabajo qe hicieron...y en Hanamonogatari tabien tiene buena calidad lastima los Capitulos 2 y 5 que no funcionan los links..\r\nBueno en fin son muy buenos  gracias por su aporte y se merecen mas :)','2016-07-29 18:11:20','2016-07-29 18:11:20');
