INSERT INTO `noticias` (`id`, `titulo`, `descripcion`, `created_at`, `updated_at`) VALUES (3,'Simultcast  Animes Temporada Verano 2016','<p style=\"text-align: center;\"><strong>En el espacio no existe un fin; aunque si un principio. -Infinito</strong><br /><strong>Asimismo, la estrella tiene un principio; due&ntilde;a de su propio poder, se destruye y muere. -Finito</strong><br /><strong>La historia nos ha demostrado que la persona que se juzga como exc&eacute;ntrica es en verdad sabia.</strong><br /><strong>Los peces que viven en el oc&eacute;ano, no entienden la vida terrestre. Todo se derrumba al conseguir la sabiduria.</strong><br /><strong>Es gracioso c&oacute;mo el hombre es capaz de superar la velocidad de la luz y un pez no puede vivir fuera del agua.</strong><br /><strong>Se considera que esta es una advertencia final de Dios hacia la gente que sabe c&oacute;mo pelear...</strong></p>\r\n<p><img src=\"https://images2.alphacoders.com/165/165150.jpg\" alt=\"\" width=\"880\" height=\"495\" /></p>\r\n<h2 style=\"text-align: center;\"><strong>Verano 2016</strong></h2>\r\n<p>Bien despu&eacute;s de unas peque&ntilde;as palabras copiadas de alg&uacute;n lado, toca decirles qu&eacute; animes son los que trabajaremos<br />esta temporada de Verano 2016, a mi parecer creo que hemos escogido lo m&aacute;s prometedor de la temporada, as&iacute; que,<br />espero sean de su agrado.</p>\r\n<h3><strong>91 Days</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21711-7cYkpDhTxZoK.jpg\" alt=\"\" width=\"226\" height=\"320\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />Este drama cl&aacute;sico de mafias se desarrolla durante la era de la Ley Seca, cuando la ley no ten&iacute;a poder alguno<br />y la mafia controlaba las calles, haciendo correr ilegalmente el alcohol. Avilio viv&iacute;a hace tiempo en cierto barrio sin ley <br />pero una disputa entre mafias result&oacute; en el asesinato de su familia, con lo que &eacute;l se escondi&oacute;.<br />A&ntilde;os m&aacute;s tarde, Avilio recibe una carta de una misteriosa persona que hace que su pasi&oacute;n por la venganza <br />resurja y decida regresar a su antiguo barrio. All&iacute;, se infiltrar&aacute; en la familia Vanetti y se acercar&aacute; a Nero.<br /><strong>Staff</strong><br />Traductor: Ruizer<br />Corrector: Deleff<br />Editor: Ruizer<br />Karaoker: Ryu19<br />Encoder: Getaudio</p>\r\n<p><a href=\"http://bit.ly/1UbcBfp\">PV</a><br />Pd: Este anime tendr&aacute; subtitulos en espa&ntilde;ol de Espa&ntilde;a.</p>\r\n<h3><br /><strong>Arslan Senki: Fuujin Ranbu</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21424-TW2bZNv3SKMT.jpg\" alt=\"\" width=\"226\" height=\"336\" /></strong></p>\r\n<p><strong>Segunda temporada.<br /></strong><strong>Staff</strong><br />Traductor: Ruizer<br />Corrector: Getaudio<br />Editor: Ruizer<br />Karaoker: Shiroe<br />Encoder: Frans185</p>\r\n<p><a href=\"http://bit.ly/1rhyM9t\">PV</a><br />Pd: Este anime tendr&aacute; subtitulos en espa&ntilde;ol de Espa&ntilde;a.</p>\r\n<h3><br /><strong>D.Gray-man Hallow</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21558-4WG9d0CRryVE.jpg\" alt=\"\" width=\"226\" height=\"316\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia de D.Gray-man nos lleva a una versi&oacute;n alternativa de inicios del siglo XX para presentarnos a Allan Walker,<br />un joven que se convierte en exorcista y trabaja para un grupo conocido como Black Order.<br />Este grupo se dedica a proteger a la humanidad de Millennium Earl.<br /><strong>Staff<br /></strong>Traductora: Luccy087<br />Corrector: Buxul<br />Editor: Luccy087<br />Karaoker: LorD_AvengeR<br />Encoder: MacroHEX</p>\r\n<p><a href=\"http://bit.ly/1PkVinO\">PV</a></p>\r\n<h3><br /><strong>Fate/kaleid liner Prisma?Illya 3rei!!</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21379-LVs7XASghK9K.jpg\" alt=\"\" width=\"226\" height=\"308\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia de Fate/kaleid liner PRISMA?ILLYA nos cuenta una versi&oacute;n alternativa del mundo de Fate/stay night, <br />en la cual Illya es una estudiante normal y corriente que un buen d&iacute;a es elegida para convertirse en magical girl.<br />As&iacute;, luchar&aacute; junto a Rin Tohsaka (Kaleido Ruby) y Luvia (Kaleido Sapphire) contra las fuerzas del mal. <br />Deber&aacute;n recoger unas cartas m&aacute;gicas desperdigadas por Fuyuki, y llegar&aacute;n a mundos alternativos, en los cuales <br />se encontrar&aacute;n con personajes de otros productos de TYPE-MOON.<br /><strong>Staff</strong><br />Traductor: Alex Hachiman<br />Corrector: Fantasma<br />Editor: Fantasma<br />Karaoker: Fantasma<br />Encoder: MacroHEX</p>\r\n<p><a href=\"http://bit.ly/1UmdSle\">PV</a></p>\r\n<h3><br /><strong>Love Live! Sunshine!!</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21584-Ff0Q6N391kz2.jpg\" alt=\"\" width=\"226\" height=\"331\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia da comienzo cuando Chika Takami, una chica de segundo y una gran admiradora de &micro;&rsquo;s, <br />decide aspirar a ser una idol escolar. Vive en el pueblo costero de Uchiura, cerca de Numazu, en la prefectura de Shizuoka. <br />En este pueblo rodeado de campos de mandarinas, las chicas estudian en la Academia Femenina Ura no Hoshi, donde quedan menos de 100 estudiantes. <br />Para aumentar la popularidad de la escuela, crear&aacute;n un grupo &ldquo;hermano&rdquo; de &micro;&rsquo;s e intentar llegar tan alto como ellas.<br /><strong>Staff</strong><br />Traductoor: Sweet_Heart<br />Corrector: Awadel<br />Editor: Luccy087<br />Karaoker: Luccy087<br />Encoder: Xarret</p>\r\n<p><a href=\"http://bit.ly/1YiOq1B\">PV</a></p>\r\n<h3><br /><strong>Masou Gakuen HxH</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21378-gH0H19BAC0qr.jpg\" alt=\"\" width=\"226\" height=\"319\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia est&aacute; protagonizada por Kizuna Hida, quien visita la academia de defensa estrat&eacute;gica Ataraxia a petici&oacute;n de su hermana mayor. <br />All&iacute; conoce a Aine Chidorigafuchi, una chica piloto de la armadura m&aacute;gica Zerosu. <br />Aine acaba quit&aacute;ndose la ropa delante de Kizuna, y tras llamarlo pervertido como es com&uacute;n en estas situaciones<br />en las que el chico no tiene ninguna culpa, pasa a preguntarle si &eacute;l es &ldquo;el elegido&rdquo;. <br />De repente la hermana de Kizuna le env&iacute;a informaci&oacute;n sobre una importante misi&oacute;n: &iquest;Tocar las tetas de Aina?. <br />En realidad es que Kizuna tiene el poder de aumentar de nivel las habilidades de las chicas mediante sus actos indecentes. <br />Estando en combate contra fuerzas de otro mundo, el futuro de la humanidad depender&aacute; del poder de Kizuna.<br /><strong>Staff</strong><br />Traductor: Fantasma<br />Corrector: Azriel<br />Editor: Fantasma<br />Karaoker: Dark_Cris14<br />Encoder: Ruizer</p>\r\n<p><a href=\"http://bit.ly/1szu5Jf\">PV</a></p>\r\n<h3><br /><strong>Nejimaki Seirei Senki: Tenkyou no Alderamin</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21410-tWeSJkL0BMOq.jpg\" alt=\"\" width=\"226\" height=\"306\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />El Imperio de Katvarna est&aacute; inmerso en una larga guerra con la vecina Rep&uacute;blica de Kioka. <br />Ikuta es un chico de 17 a&ntilde;os que vive en el Imperio de Katvarna y, aunque es un vago de primera y su &uacute;nico inter&eacute;s<br />parecen ser las mujeres, por cosas de la vida acaba haciendo el examen que prepara a los comandantes de alto rango del ej&eacute;rcito.<br />Contra todo pron&oacute;stico, Ikuta supera el examen con creces y se acaba convirtiendo en un gran comandante admirado por todos, <br />y es que su gran intelecto se convertir&aacute; en un gran recurso a la hora de sobrevivir en un mundo consumido por la guerra&hellip;<br /><strong>Staff</strong><br />Traductor: Shiroe<br />Corrector: Getaudio<br />Editor: Shiroe<br />Karaoker: Shiroe<br />Encoder: Getaudio</p>\r\n<p><a href=\"http://bit.ly/1XN5cqU\">PV</a></p>\r\n<h3><strong>Orange</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21647-umy1YoqAhN98.jpg\" alt=\"\" width=\"226\" height=\"333\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />Todo el mundo se arrepiente en la vida. &iquest;Y si pudieras tener la oportunidad de cambiar el pasado?<br />Cuando Naho Takamiya, de 16 a&ntilde;os, recibe una carta misteriosa que dice ser de parte de su yo del futuro con 26 a&ntilde;os,<br />su vida cambia por completo. La carta le explica c&oacute;mo un nuevo estudiante transferido llamado Naruse Kakeru llegar&aacute; a su clase,<br />y que no le quite el ojo de encima. <br />&iquest;Por qu&eacute;? Naho deber&aacute; decidir si hacer caso a la cr&iacute;ptica advertencia de la carta o no,<br />y qu&eacute; significar&iacute;a no solo para su futuro, sino tambi&eacute;n para el de Kakeru.<br /><strong>Staff</strong><br />Traductor: Martinee<br />Corrector: Raku<br />Editor: Raku<br />Karaoker: Ian<br />Encoder: Eleane Cross</p>\r\n<p><a href=\"http://bit.ly/1U0q47w\">PV</a></p>\r\n<h3><br /><strong>Qualidea Code</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21557-TwRE1AS858Bn.jpg\" alt=\"\" width=\"226\" height=\"318\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia del anime se desarrolla en un mundo en el que los humanos luchan una guerra sin fin contra los UNKNOWN,<br />los cuales lanzaron su invasi&oacute;n varias d&eacute;cadas atr&aacute;s. <br />Los ni&ntilde;os entonces entraron en un largo sue&ntilde;o para poder escapar del peligro y sobrevivir. Cuando despiertan, <br />los ni&ntilde;os descubren que tienen poderes sobrenaturales, as&iacute; que crean ciudades en las que defenderse en Tokio, <br />Kanagawa y Chiba para proteger el pa&iacute;s de los UNKNOWN, que aparecen entrando por un portal en la Bah&iacute;a de Tokio.<br /><strong>Staff</strong><br />Traductor: SwordGeass<br />Corrector: Mugiwara21<br />Editor: Shiroe<br />Karaoker: Shiroe<br />Encoder: Xarret</p>\r\n<p><a href=\"http://bit.ly/1WJcGdW\">PV</a></p>\r\n<h3><br /><strong>Taboo-Tattoo</strong></h3>\r\n<p><strong><img src=\"http://anilist.co/img/dir/anime/reg/21031-q8GKDTABPehD.jpg\" alt=\"\" width=\"226\" height=\"317\" /></strong></p>\r\n<p><strong>SINOPSIS</strong><br />La historia est&aacute; protagonizada por Justice Akazuki &ldquo;Seigi&rdquo;, un joven con un gran don para las artes marciales. <br />Seigi ayuda un d&iacute;a a un vagabundo al que estaban amenazando unos matones, y entonces el hombre regala a Seigi<br />un objeto que le imprime un tatuaje en la palma de la mano. Sin embargo, el tatuaje no es uno normal y corriente, <br />sino un arma que le proporciona a Seigi poderes como viajar en el espacio tiempo. <br />Seigi entonces conoce a una agente norteamericana llamada Ijii cuyo deber es recuperar los tatuajes, y decide ayudarla, <br />vi&eacute;ndose envuelto as&iacute; en una conspiraci&oacute;n a nivel nacional.<br /><strong>Staff</strong><br />Traductor: Ruizer<br />Corrector: Buxul<br />Editor: Ruizer<br />Karaoker: Dark_Cris14<br />Encoder: Ice9</p>\r\n<p><a href=\"http://bit.ly/1U5KVM5\">PV</a><br />Pd: Este anime tendr&aacute; subtitulos en espa&ntilde;ol de Espa&ntilde;a.</p>\r\n<p>Estos ser&aacute;n los animes que trabajaremos para verano, as&iacute; mismo contin&uacute;an las series de Re Zero, Sousei no Onmyouji, Endride, Gyakuten y Dragon Ball Super.<br />Espero que nos sigan acompa&ntilde;ando en nuestro trabajo y nos donen mucho para motivarnos. :3</p>','2016-07-01 22:07:09','2016-07-02 02:07:09'),(4,'¡3º Aniversario de Underworld Fansub!','<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://i.imgur.com/fMUx7Qr.jpg\" alt=\"MUMEI-CHAN\" width=\"935\" height=\"617\" /></p>\r\n<p style=\"text-align: justify;\">Como dice la imagen, hoy cumplimos 3 a&ntilde;os en el mundo de la subtitulaci&oacute;n de anime, gracias a toda la gente que ha hecho esto posible, desde su creador FaNtAsMa y todos los secuases malignos del fansub... han pasado 3 a&ntilde;os y pues... &iexcl;Oh! ya no se que escribir <em class=\"_lew\" title=\"Emotic&oacute;n pacman\"><span class=\"_4mcd\">:v&nbsp;</span></em> la verdad, plane&aacute;bamos un discurso que hiciera que se mojaran pero no se nos ocurri&oacute; nada. &iquest;preparamos algo para el aniversario?... hahahahahahahahahahahahaha pues ver&aacute;n preparamos muchas cosas pero como somos unos vagos el numero se redujo r&aacute;pidamente.... y pues tampoco saldr&aacute;n hoy... &iexcl;pero en la semana! si, en la semana... creo... bueno eso es todo lo que ten&iacute;amos que escribir <em class=\"_lew\" title=\"Emotic&oacute;n pacman\"><span class=\"_4mcd\">:v</span></em></p>\r\n<p style=\"text-align: justify;\"><em class=\"_lew\" title=\"Emotic&oacute;n pacman\"><span class=\"_4mcd\">Atentamente: Meltdowner &amp; el Club de Editores Vagos.</span></em></p>','2016-07-01 22:05:47','2016-07-02 02:05:47');
