INSERT INTO `reclutamientos` (`id`, `nombre`, `nick`, `email`, `pais`, `biografia`, `fecha_nacimiento`, `sexo`, `puesto`, `experiencia`, `tiempo_dedicacion`, `dias_disponibles`, `comentarios`, `team`, `created_at`, `updated_at`) VALUES (1,'Jose ','Azriel','josec_8000@hotmail.com','Venezuela','pues basicamente soy una persona normal, que le gusta leer buenos mangas y anime.','11/09/96','Hombre','Corrector','Ninguna, pero me a llamado la atencion colaborar con la comunidad del anime/manga para que este pueda llegar a todos, siempre e tenido respeto por los que hacen esto y siento que es la hora de aportar tambien.  ','4 horas','prácticamente todos de 4 a 3 horas.','a mi me gustaria ayudar en lo que pueda pero no me a que dado claro que papel desempeñan algunos puestos como el timmer, encoder etc... de antemano digo que no tengo ninguna experiencia. ','Oppais','2016-03-17 22:31:48','2016-03-17 22:31:48'),(2,'Franky Stone','franky','admin@hentakku.com','Perú','Me gusta el cereal','30/01/666','Hombre','Social Manager','no','Cuanto sea necesario','todos los dias','¿puedo ser admin?','Lolicon','2016-03-17 22:48:03','2016-03-17 22:48:03'),(3,'Carlos','eLGantiva678','gantiva123@outlook.com','Colombia','Me gusta el anime.','00/00/00','Hombre','Traductor','Hice parte de un Fansub llamado Proyecto432 donde traduje varias series.','4 horas','Sabados','¿Este fansub es muy activo o regular? :v','Oppais','2016-03-21 21:09:06','2016-03-21 21:09:06'),(4,'Gustavo Chávez','Hatchiyack','chavezpazgustavo.98@gmail.com','Perú','Tengo 17 años, voy al instituto, me gustan los animes de pelea, acción como Dragon Ball, One Piece, Shingeki No Kyojin, etc...','23 de abril de 1998','Hombre','Corrector','Si, actualmente tengo mi propio \"Fansub\" aunque estoy solo, no me va bien, así que me gustaría unirme a un Fansub conocido, puedo trabajar en otros puestos si aprendo.','4 horas','Todos los días de la semana a partir de las 4 de la tarde, Domingos casi todo el día.','No entendí la pregunta \"¿Qué team eres?\" así que la dejaré como está :D','Lolicon','2016-03-23 06:52:46','2016-03-23 06:52:46'),(5,'Erika ','1003308565 ','erikaperezc@hotmail.com','Colombia ','Soy una persona que le gusta mucho el anime y manga. Me gustaría aprender como se editan los mangas(todo lo relacionado) ','23-jun-1996','Mujer','Editor','No. Tengo ninguna experiencia ','1 hora','Todos los días en las noches. Sábados por la tarde y todo el domingo ','Por favor ','Shotacon','2016-03-26 04:04:55','2016-03-26 04:04:55'),(6,'Matias','Zero','mathy.gamer11@gmail.com','Chile','Bueno, tengo 16 años, Voy en educación media, me gusta el anime (?, el rap, etc','11-01-2000','Hombre','Corrector','No tengo experiencia, me gustaria aprender','2 horas','Sábado y Domingo','Nop','Oppais','2016-03-26 05:49:48','2016-03-26 05:49:48'),(7,'Ignacio','Nachius','ibardin@hotmail.com','Argentina','Apasionado del animé desde niño. Me gustaría colaborar para subtitular animés, ya que muchos de los que veo por internet dicen al principio \"fansubeado por Underworld\".','02/01/1995','Hombre','Traductor','He estudiado inglés desde los 9 años en institutos y luego estudié 2 años la carrera \"Traductorado Bilingüe Inglés-Español\" en la UNCuyo. Podría decirse que tengo un nivel de inglés prácticamente nativo.','Cuanto sea necesario','Lunes a viernes o algunos fines de semana (dependiendo de las circunstancias).','Tengo muy buena ortografía y redacción.','Oppais','2016-03-30 19:20:21','2016-03-30 19:20:21'),(8,'Loel Kevin','Koel','koelbeac@gmail.com','Peru','Hola! Soy nuevo en el esto y quisiera aprender de ustedes que son el mejor fansub que he conocido a lo largo de mis años de vida. Espero formar parte de su dream team.','28 de Enero','Hombre','Traductor','No, soy nuevo.','4 horas','Ni idea, aveces tengo tiempo y aveces no, pero a lo largo de la semana tengo unas horitas libres (SIEMPRE)','Putos','Oppais','2016-03-31 03:15:47','2016-03-31 03:15:47'),(9,'Papu 98sdfsadfasdasd','Aki Mei','chocolate@weonasd22.org','secreto','Me gustan las oppais xd','17/12/5554','Hombre','Social Manager','my little pony (wof wof)','Cuanto sea necesario','todos','Las oppais las mandan por amazon?','Oppais','2016-03-31 03:51:57','2016-03-31 03:51:57'),(10,'Luis Mario','tecno1814','tecno1814@live.com','México','Soy un estudiante de prepa, otaku, me doy mis roles por por el mundo anime y manga, siempre parezco estar desocupado y viviendo una vida tranquila pero no lo es :v','15/12/1997','Hombre','Webmaster','Soy webmaster de la pagina mganimes.co, si bien la pagina inicial no la hice yo(fueran los dueños), he ayudado corrigiendo errores de diseño y de la db, diseñe en el senpaiplayer que poco a poco es implementado en la web, pueden probarlo aqui: http://mgan','4 horas','martes, miercoles, jueves, sabado y domingo','me gustaria unirme a uds, tambien puedo fungir como encoder, timmer y traductor ','Lolicon','2016-04-01 04:13:22','2016-04-01 04:13:22'),(11,'Yoselin Romero','Shakugan XD','melodicowsns@hotmail.com','México','Soy timida, me gusta ver anime comer chocolate tomar café dibujar \r\nsoy muy rara me lo has dicho y perveetida un poco 7u7 XD','13 de mayo 2001','Mujer','Traductor','Pues no tratare de aprender','1 hora','Lunes, Domingos, Martes, Jueves ','Esto importara?','Lolicon','2016-04-15 07:55:06','2016-04-15 07:55:06'),(12,'Ivan perez','Tomoya-kun','izaaiperez@gmail.com','Mexico','Bueno yo me llamamos ivan vivo en \r\nPuebla y apenas estoy comenzando\r\nAver anime KAWWAII!!','24-11-2000','Hombre','Traductor','No tanto','1 hora','Los sábado y domingos ','No tengo ninguna duda ','Oppais','2016-04-16 19:33:56','2016-04-16 19:33:56'),(13,'Iban ','Yomoya-kun','izaaiperez@gmail.com','Puebla','Vivo en puebla y apenas estoy comenzando aver anime ','24 de noviembre del 2000','Hombre','Social Manager',' No mucha ','1 hora','Sábados y domingo','No tengo ninguna','Oppais','2016-04-16 19:37:24','2016-04-16 19:37:24'),(14,'Rafael Valero','Raccoon','rafaeel.valeroo@gmail.com','Venezuela','Actualmente soy un estudiante de ingeniería informática, me encanta la literatura y también todo lo referente a animación japonesa, dígase manga, novelas ligeras o anime. Me considero amante de la naturaleza, me encanta acampar y practico escalada, aspira','26/01/1996','Hombre','Traductor','Fui traductor voluntario en merryscans y ayudé en una biografía aun no publicada que un amigo se encarga de traducir, podría hacer tanto corrector como traductor, depende del puesto que haya, en el lenguaje español he escrito un par de cuentos para concur','Cuanto sea necesario','Los Lunes actualmente son días pesados para mi, pero en 2 semanas termino semestre y estaré mucho más relajado y podre estar disponible toda la semana.','¿Pagan por el trabajo?\r\n¿Es la realidad sólo una deformación causada por nuestra percepción?\r\n\r\nTambién podrían agregar esta pregunta para el reclutamiento \"¿Cual es la respuesta a la vida, el universo y todo lo demás?\" así sabrían quienes son los elegidos(?)','Lolicon','2016-04-25 05:28:30','2016-04-25 05:28:30'),(15,'Omar','azhtsk','azhtsk@icloud.com','Mexico','Me gusta el anime, creo que tengo un buen nivel de ingles y quiero colaborar con algo.','21/04/98','Hombre','Traductor','No tengo','1 hora','Lunes a viernes','creo que no','Lolicon','2016-04-26 02:10:03','2016-04-26 02:10:03'),(16,'Alejandro Pérez Herrera','Alex','perezherreraalejandro@gmail.com','México','Soy un estudiante de bachillerato, actualmente tengo interes de empezar a estudiar la Licenciatura en Lenguas el proximo año (Hasta el momento he estudiado Inglés dos años en la UNAM, y otros idiomas por mí cuenta), así que me gustaría mejorar mi dominio ','22 de agosto de 1998','Hombre','Traductor','Soy traductor (Inglés-Español) en el proyecto de traducción de la Novela Visual Fate/Hollow Ataraxia desde hace 3 meses. \r\n\r\nhttp://fhatranslation.blogspot.mx/','4 horas','Creo que podría estar por lo menos una hora diaria conectado y unas dos desconectado, aunque por temporadas podria disponer de más.','Jejeje, ¿No hay un team para gente que no encaja del todo en alguno de los otros 4? ¿Algo así como un Team Kuudere?','Oppais','2016-04-27 02:34:31','2016-04-27 02:34:31'),(17,'Alejandro Pérez Herrera','Alex','perezherreraalejandro@gmail.com','México','Estudio el bachillerato actualmente, me gustaría estudiar Lenguas como carrera universitaria.\r\n\r\nEn este grupo me gustaría ser traductor para pulir mi habilidad con el idioma inglés, aunque tambien podría aprender funciones de otros puestos.\r\n\r\nMe gusta c','22 de agosto de 1998','Hombre','Traductor','Desde hace tres meses soy traductor inglés-español en el proyecto de traducción de Fate/Hollow Ataraxia.\r\nhttp://fhatranslation.blogspot.mx/','4 horas','De lunes a viernes, seguro, aunque puede que tambien pueda los fines de semana.','¿No pueden haber mas teams? xD','Oppais','2016-04-27 02:42:50','2016-04-27 02:42:50'),(18,'Mauricio Arias','Skyrio','mauhans@hotmail.com','Colombia','Soy bastante serio cuando a trabajo se refiere, responsable, me gusta mucho trabajar para los fansubs, para que los fans sepan y conozcan nuestro trabajo. Soy sociable y no me caen bien las personas que mantienen alejadas o no están al tanto de lo que hac','22 Junio de 1999','Hombre','Karaoker','Tengo experiencia en Aegisub, aegisub manejo todo lo avanzado cuando a efectos se refiere. Template, mods, etc... También podría ser traductor, pero eso ya sería cuestiones de tiempo','Cuanto sea necesario','Los días de la semana estaría disponible las horas de la mañana y las horas de la noche, los sábados y domingo estaría disponible todo el día.','Ustedes son un excelente fansub, y quisiera trabajar con ustedes, muchos de mis animes favoritos están hechos por ustedes y precisamente por eso, quiero unirme.','Oppais','2016-04-28 17:58:10','2016-04-28 17:58:10'),(19,'Fabian Andres','Onii-Sama','oniisama2016@gmail.com','Colombia','servicial,trabajador','05/11/1995','Hombre','Corrector','tengo experencia en dibujar y quiero convertirme en mangaka','Cuanto sea necesario','mm no lose pero creo q seria el lunes martes miercoles viernes y sabado.','los dias q no presente tende algun problema con underworld','Lolicon','2016-05-04 00:19:03','2016-05-04 00:19:03'),(20,'fabian andres vargas torres','llFabianAndresll','favt2017@gmail.com','Colombia','Estoy Trabajo En Mi Computador..','5 . 11 . 1995','Hombre','Editor','¿ QUE HACEMOS ?','Cuanto sea necesario','Solo En La Tardes : Lunes,Martes,Miercoles,Jueves,Viernes Y Sabado..','Ninguno','Lolicon','2016-05-06 02:03:56','2016-05-06 02:03:56'),(21,'Darnes','Yomi','smomyoi@gmail.com','España','Amante del anime, por no decir adicto, jugador de rol en los ratos libres. Soy una persona algo callada y tranquila, pero no por ello ','20/02/1992','Hombre','Editor','Estuve trabajando un tiempo como editor de manga, pero el fansub se olvido de mi y nada mas','1 hora','En principio, todos, aunque los fines de semana son erraticos','Pues un poco de paciencia conmigo, que no tengo experiencia en trabajos de este tipo pero, para compensar, muchas ganas de ayudar :)','Lolicon','2016-05-06 15:37:00','2016-05-06 15:37:00'),(22,'Manuel','mangapolis','anime@mangapolis.net','España','Me encanta el anime y admiro el currazo que os traéis los fansubs, y sobre todo lo bien que lo hacéis vosotros. Así que si algún día necesitáis a alguien aquí estoy.','28/10/1993','Hombre','Corrector','Como encoder con el programa MediaCoder.','2 horas','A diario, 1 hora por la noche\r\nFines de semana, 2 horas.','PUESTO A DESEMPEÑAR: Corrector, Timer, Encoder (no me dejaba elegir las 3). También puedo subir contenidos (1 MB/seg. de subida).','Lolicon','2016-05-08 18:51:20','2016-05-08 18:51:20'),(23,'Manuel Villarroel','manolito62','manolito62@hotmail.com','Venezuela','Ingeniero en informatica, domino el idioma ingles, y en estos momentos estoy intentanto aprender japones.','16/10/1988','Hombre','Traductor','Hasta ahora la unica experience fue pasar 2 capis de un manga de español a ingles (trinity seven 46 and 44)','Cuanto sea necesario','Estoy libre todos los dias (home gateguard) pero para definir un buen punto, sabados y domingos.','=3 me enamore de esta pagina a la primera, la unica que e visto que no me congelo my minilaptop con ads, los adoro por no tener una pagina de \"ads con algo de anime\".','Lolicon','2016-05-15 01:37:23','2016-05-15 01:37:23'),(24,'Jesus','Zhand','mianimeblog@gmail.com','Colombia','Pss digamos que le dedico mi mayor tiempo libre  a ver anime, si no tengo nada que hacer llego a ver 3 animes por semanas, me gusta salir a eventos y comer xD..','14-09-1992','Hombre','Traductor','Fui creador de Doumei No Fansub, fansub para mangas pero en ese entonces estaba en decimo semestre de la u y me toco abandonarlo y dejarlo con mis compañeros.','Cuanto sea necesario','Todos :v','Respecto a que se hara, aunque quisiera saber los otros puestos, tengo buen manejo de software, diseño web etc ','Lolicon','2016-05-25 06:34:52','2016-05-25 06:34:52'),(25,'Raul','rul-o','tobetres@gmail.com','México','me gusta el anime y el manga','28/06/95','Hombre','Timmer','se timmear en aegisub pero por que aprendí yo solo','2 horas','lunes a viernes de 16;00 a 18:00\r\ny los sábados de 20:00 a 22:00 ','ninguna','Oppais','2016-06-08 04:32:47','2016-06-08 04:32:47'),(26,'Alexander','Aleister','aleisster@outlook.com','España','Un vago que solo sabe traducir y hacer karaokes V: ','20/02/1995','Hombre','Karaoker','¿Hace falta decirlo? V:','Cuanto sea necesario','Todos los dias','¿Porque el profesor Charles Xavier no puede meterse en la cabeza de magneto y si en la de Lobezno aun sabiendo que su cabeza esta hecha de adamantio? ','Lolicon','2016-06-19 04:38:55','2016-06-19 04:38:55'),(27,'Gustavo','Esdeath14','tavoxzp@gmail.com','Republica Dominicana','El anime es mi pasion lo veo desde que tengo memoria Gracias a mi  hermnano.','11/02/99','Hombre','Editor','Comenzare a editar videos ','1 hora','3','no tengo mucha experiencia osea voy a nesecitar de su ayuda para poder crecer y aprender mas.','Oppais','2016-06-21 07:16:38','2016-06-21 07:16:38'),(28,'Arian Noor','MiniDaddy ','ariancanbu10@gmail.com','España','Quiero ser traductor y ayudar a este fansub a publicar los proyectos lo mejor posible para que la gente que ama el manga tanto como yo lo pueda disfr2','10-11-1999','Hombre','Traductor','Formé parte de varios Fansubs así que mas o menos tengo experiencia ','Cuanto sea necesario','Todos','No solo quiero ayudar en lo que pueda ','Oppais','2016-06-25 07:35:35','2016-06-25 07:35:35'),(29,'Karolym','KYM','karolym22_hi2ro2di2@hotmail.com','Perú','Pues que les diré... \r\nTorpe, olvidadiza, fanática a los libros y a los mangas.\r\nMe niego a admitir que soy una fujoshi.\r\n','01/04','Mujer','Traductor','La verdad, solo eh llegado a traducir mangas (y esto es mucho decir), pero no por falta de compromiso, si no de oportunidad. No seré experta pero me gusta mucho el idioma, y que mejor que entrar a un fansub para desarrollarme y hacer lo que me gusta.','1 hora','Miércoles y Domingos (gracias universidad)','¿Cómo se trabajan los envíos de las traducciones?\r\nYo solía enviarlos en word en forma de diálogos, pero no se si esto es diferente.','Yaoista','2016-06-28 06:01:24','2016-06-28 06:01:24'),(30,'Adrián','KDorianKs','bartmon1988@hotmail.com','España','Soy un apasionado por el mundo gamer y nipón en general. Mi empleo me quita poco tiempo libre por lo que lo paso la mayor parte del tiempo viendo anime o jugando a videojuegos. Completamente fanático! Y qué mejor que traducir para tomarme esto con un punt','01/06/1988','Hombre','Traductor','He sido traductor para Fansubs, aunque mi paso se limitó a un periodo corto (unos 6 meses en activo). Más tarde tuve la posibilidad de colaborar como redactor para VyC, Videojuegos y Consolas, web dedicada al mundo de los videojuegos y con los que partici','1 hora','Todos','No, todo claro :)','Yaoista','2016-07-19 21:13:29','2016-07-19 21:13:29'),(31,'Erick','ErickleonZ','erickleonsandoval1998@gmail.com','Venezuela','Soy un joven de 18 años fan del anime y del manga actualmente estoy 1er semestre de ingenieria.','20/06/1998','Hombre','Traductor','No, es primera vez que colaboro con un Fansub','6 horas','Martes,Miercoles,Viernes,Sabado y Domingo','No','Lolicon','2016-07-21 06:05:34','2016-07-21 06:05:34'),(32,'Erick','ErickleonZ','erickleonsandoval1998@gmail.com','Venezuela','Soy un joven de 18 años fan del anime,del manga y de los juegos actualmente estoy 1er semestre de ingenieria.','20/06/1998','Hombre','Traductor','No, es primera vez que colaboro con un Fansub, pero tengo experiencia en Fansub de Juegos','6 horas','Martes,Jueves,Viernes,Sabado y Domingo','No','Lolicon','2016-07-21 06:07:07','2016-07-21 06:07:07'),(33,'Andrés.','Mystix.','andresantigoloretoaguero@hotmail.com o andresantigoloretoaguero@gmail.com','República Dominicana, pero soy de Venezuela.','No sé que podría poner aquí, ya que puse mi nombre, mi fecha de nacimiento y el país donde nací. xD\r\n','03 de abril del 2002.','Hombre','Corrector','No tengo ninguna experiencia previa.','1 hora','Actualmente estoy de vacaciones, por lo que podría estar casi todos los días. \r\nCuando ya no esté de vacaciones, serían los viernes, sábados y tal vez los domingos.','Debo aclarar que mi ortografía no es perfecta, pero tampoco es mala (no suelo cometer muchos errores).\r\nNo podré ayudar a corregir fallos de traducción, ya que no sé nada de japonés.\r\nY si se puede, me gustaría aprender a hacer el karaoke.','Lolicon','2016-07-22 23:54:59','2016-07-22 23:54:59'),(34,'Fátima','Llanos','fatimallanosmamani45@gmail.com','peru','me gustaría ayudar a ustedes ya que estoy de vacaciones esta semana y estoy libre y por eso también lo hago por que me gusta el manga como el anime :)','17/05/1997','Mujer','Editor','La verdad no tengo experiencia pero me gustaría ayudar porque me parece  un trabajo que ya que me gusta lo llegue a desarrollar y poder ayudar     :O','Cuanto sea necesario','sabados ,domingos y algunos miercoles','podria renunciar si no puedo estar un mes o una semana sin contactar oporque no me gusta ser una molestia :L','Shotacon','2016-07-25 04:07:16','2016-07-25 04:07:16'),(35,'Raymond','Roy Mustang ','raymond.garabito@gmail.com','República Dominicana','Fans del anime, manga y novelas.','05/05/1990','Hombre','Traductor','Como traductor de novelas, nunca he  trabajado con anime.','2 horas','Jueves a domingo.','Programas que usan, donde conseguir los materiales...lo básico.','Lolicon','2016-07-31 16:37:46','2016-07-31 16:37:46'),(36,'Sandro','Sancubs','sancosentino@gmai.com','Argentina','La verdad es que tenia ganas de unirme a un fansub porque me gusta la idea de subtitular, aparte de que me ayuda a tener practica para el futuro','16/08/1995','Hombre','Traductor','Estudio Traductorado Público en Inglés. Voy por el segundo de los cuatro años para recibirme. Calculo que tengo la experiencia necesaria como para poder desempeñar este rol aquí, aparte de ayudar.','Cuanto sea necesario','Estoy disponible solamente los sábados y los domingos, debido a mi estudio que es en la semana.','La verdad que no se que son los team lolicon, shotacon, oppais y yahista. Pero elijo oppais. Espero haber elejido bien.','Oppais','2016-08-05 03:09:29','2016-08-05 03:09:29'),(37,'Ximo','Daimaou14','ximollacer17@gmail.com','España','Aún estoy estudiando así que en verano puedo dedicar un montón de tiempo, pero una  vez empiece el colegio de nuevo tendré menos tiempo disponible.','19-07-2000','Hombre','Corrector','No','4 horas','Todos los días','Pregunta tonta: ¿Con qué programa se hacen los subtítulos?','Oppais','2016-08-06 19:18:35','2016-08-06 19:18:35');
